import React, { useEffect, useState } from 'react';
import { useParams, useNavigate } from 'react-router-dom';
import 'popper.js';
import "../../../css/Admin/view-state.css"

export function ViewState() {

    const navigate = useNavigate();
    const { id } = useParams();
    const [state, setState] = useState(null);
    const [images, setImages] = useState([]);

    const [userRole, setUserRole] = useState(null);
    useEffect(() => {

        const token = localStorage.getItem('token') 

        axios.get('http://localhost:3001/inicio', {
            headers: {
                'Content-Type': 'application/json',
                'Authorization': token,
            },
        })
            .then((response) => {
                const data = response.data;

                if (data.decodeToken.rolUser === 2) {
                    setUserRole(data.decodeToken.rolUser);
                } else {
                    // Redirigir al usuario a una pÃ¡gina de acceso denegado
                    navigate('/access-denied');
                }
            })
            .catch((error) => {
                console.error('Error:', error);
                navigate('/login');
            });

        fetch(`http://localhost:3001/verInmueble/${id}`)
            .then(response => response.json())
            .then(response => {
                setState(response.rows);
                setImages(response.imageResult);
                console.log(response);
            })
            .catch(error => {
                console.error('Error:', error);
                setState(null);
            });
    }, [id]);

    function editarInmueble() {
            navigate(`/admin/UpdateState/${id}`)
    }

    return (
        <div >
            {state ? (
                <>
                    <div className="information-header">
                        <h2 className="title-header">{state.tipoInmueble} {state.barrio}</h2>
                    </div>
                    <div className='container-propierty-state'>
                        <div className="information-body-div">
                            <div className='img-box-div'>
                                {images && images.imagen && (
                                    <img className="img-view-state" src={`http://localhost:3001/${images.imagen}`} alt={`Inmueble ${state.idInmueble}`} />
                                )}
                            </div>
                            <div className="action-buttons">
                            <button className="button-state" type="submit" ><p className="txt-white"> Eliminar</p></button>
                            <button className="button-state" type="submit" onClick={() => editarInmueble()}><p className="txt-white"> Editar</p></button>                            </div>
                        </div>
                        <div className="action-div">
                            <div className="caracteristicas-div">
                                <h3 className="txt-black title-caracteristicas">Caracteristicas</h3>
                                <p className="txt-black mrg-5"><strong className="txt-black  mrg-r">Precio: </strong>{state.precio} </p>
                                <p className="txt-black mrg-5"><strong className="txt-black  mrg-r">Barrio: </strong> {state.barrio}</p>
                                <p className="txt-black mrg-5"><strong className="txt-black  mrg-r">Direccion: </strong> {state.direccion}</p>
                                <p className="txt-black mrg-5"><strong className="txt-black  mrg-r">Ãrea del Terreno: </strong> {state.areaTerreno} mÂ² </p>
                                <p className="txt-black mrg-5"><strong className="txt-black  mrg-r">Ãrea construida: </strong> {state.areaConstruida} mÂ²</p>
                                <p className="txt-black mrg-5"><strong className="txt-black  mrg-r">Estado de construcciÃ³n: </strong>{state.estadoConstruccion}</p>
                            </div>

                            <div className="distribucion-div">
                                <h3 className="txt-black title-caracteristicas">DistribuciÃ³n</h3>
                                <p className="txt-black mrg-5"><strong className="txt-black mrg-r">NÃºmero de habitaciones: </strong> {state.numHabitaciones}</p>
                                <p className="txt-black mrg-5"><strong className="txt-black  mrg-r">NÃºmero de pisos: </strong> {state.numPisos}</p>
                                <p className="txt-black mrg-5"><strong className="txt-black  mrg-r">NÃºmero de baÃ±os: </strong> {state.numBaÃ±os}</p>
                            </div>
                        </div>
                    </div>
                </>
            ) : (
                <p>Cargando detalles del inmueble...</p>
            )}
        </div>

    )
}
